var tipuesearch = {"pages": [{'title': 'about', 'text': '\n', 'tags': '', 'url': 'about.html'}, {'title': '迴圈程式', 'text': "gist: https://gist.github.com/40823131/0cf03a8b73201ed411749211d7199d20 \n https://mde.tw/dartpad/?id=0cf03a8b73201ed411749211d7199d20 \n void main() {\n  for (int i = 0; i < 5; i++) {\n    print('hello ${i + 1}');\n  }\n} \n", 'tags': '', 'url': '迴圈程式.html'}, {'title': '引用倉儲 Dart 程式', 'text': '程式碼位於: https://github.com/40823131/cp2019/blob/master/downloads/dart_ex/for \n 包含 yaml 檔案: https://github.com/40823131/cp2019/blob/master/downloads/dart_ex/for/dartpad_metadata.yaml \n 以及所要引用的 Dart 程式: https://github.com/40823131/cp2019/blob/master/downloads/dart_ex/for/main.dart \n 若為 console 模式, 利用 main.dart 與 dartpad_metadata.yaml 透過 embed-dart.html\xa0 導入. \n 若為網頁模式, 利用 main.dart, index.html style.css 與 dartpad_metadata.yaml 透過 embed-html.html 導入. \n main.dart 原始碼: \n // 在所有函式定義外圍所宣告的變數, 稱為全域變數, 有效範圍包含各函式內部與外部\n// for 迴圈所使用的索引值, 宣告為整數 (integer)\nint i;\n// 累加起始值 start 宣告為整數, 且設為 1\nint start = 1;\n// 累加終止值 end 宣告為整數, 且設為 10\nint end = 10;\n// 累加總數值 sum 宣告為整數\nint sum;\n\n// 定義 main() 主函式內容, 目的在利用 for 迴圈進行整數的累加\nmain(){\n  // 將前面已經宣告為全域整數的變數 sum 設為 0, 表示從 0 開始進行累加\n  sum = 0;\n  // 執行 for 迴圈內的整數累加設計, 使用前面已經宣告為全域整數的 i 作為索引變數\n  // 分別從 start 開始累加至 end, 且每次迴圈的索引值增加 1\n  for(i=start;i <= end ;i++){\n    // 當索引變數 i 所對應的值小於或等於 end 時, 對 sum 變數加上 i\n    sum += i;\n    // 可以在 for 迴圈每一個階段運算時, 列出當時的 sum 對應值, 查驗是否正確\n    //print("$sum");\n  }\n  // for 迴圈累加完成後, 列出最後訊息\n  print(\'從 $start 累加至 $end 的總數值為 $sum\');\n} \n dartpad_metadata.yaml 設定檔案: \n # 說明此 yaml 檔案所引用程式的目的\nname: Dart for loop example1\n# 引用模式為純 dart 或 html 模式\nmode: dart\n# 所包含引入的程式名稱, 若為純 dart 則只包含 dart 程式, 若為 html 模式, 則加入 index.htm 與 style.css\nfiles:\n  - name: main.dart \n 利用 iframe 標註引入 For loop 程式: \n \n', 'tags': '', 'url': '引用倉儲 Dart 程式.html'}, {'title': 'image', 'text': '', 'tags': '', 'url': 'image.html'}]};